import React from 'react'
import classes from './thumbnails.module.css'
import { Link } from 'react-router-dom'
const Thumbnails = ( {foods} ) => {
  return <ul classname={classes.list}>
       {
        foods.map( food =>
        <li>
            <Link to={'/food/${food.id}'}>

            </Link>
        </li>

        )
        }
  </ul>
}

export default Thumbnails
